import React from "react";
import { ToggleWrapper, Notch } from "../style/ToggleButton.style";

const ToggleButton = ({
  children,
  disabled,
  className,
  fullWidth,
  ...otherProps
}) => {
  return (
    <ToggleWrapper>
      <Notch active />
    </ToggleWrapper>
  );
};

export default ToggleButton;
